
CREATE TABLE `brand` (
  `BRAND_ID` int NOT NULL,
  `BRAND_NAME` varchar(100) NOT NULL,
  `BRAND_TYPE` varchar(20) NOT NULL,
  PRIMARY KEY (`BRAND_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;

CREATE TABLE `customer` (
  `CUST_CODE` int NOT NULL,
  `CUST_FNAME` varchar(20) NOT NULL,
  `CUST_LNAME` varchar(20) NOT NULL,
  `CUST_STREET` varchar(70) NOT NULL,
  `CUST_CITY` varchar(50) NOT NULL,
  `CUST_STATE` varchar(2) NOT NULL,
  `CUST_ZIP` varchar(5) NOT NULL,
  `CUST_BALANCE` decimal(16,2) NOT NULL,
  PRIMARY KEY (`CUST_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;


CREATE TABLE `department` (
  `DEPT_NUM` int NOT NULL,
  `DEPT_NAME` varchar(50) NOT NULL,
  `DEPT_MAIL_BOX` varchar(3) NOT NULL,
  `DEPT_PHONE` varchar(9) NOT NULL,
  PRIMARY KEY (`DEPT_NUM`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;


CREATE TABLE `employee` (
  `EMP_NUM` int NOT NULL,
  `EMP_FNAME` varchar(20) NOT NULL,
  `EMP_LNAME` varchar(25) NOT NULL,
  `EMP_EMAIL` varchar(25) NOT NULL,
  `EMP_PHONE` varchar(20) NOT NULL,
  `EMP_HIREDATE` date NOT NULL,
  `EMP_TITLE` varchar(45) NOT NULL,
  `EMP_COMM` decimal(16,2) NOT NULL,
  `DEPT_NUM` int NOT NULL,
  PRIMARY KEY (`EMP_NUM`),
  CONSTRAINT `employee_department_fk` FOREIGN KEY (`DEPT_NUM`) REFERENCES `department` (`DEPT_NUM`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;

CREATE TABLE `invoice` (
  `INV_NUM` int NOT NULL,
  `INV_DATE` date NOT NULL,
  `CUST_CODE` int NOT NULL,
  `EMPLOYEE_ID` int NOT NULL,
  `INV_TOTAL` decimal(16,2) NOT NULL,
  PRIMARY KEY (`INV_NUM`),
  CONSTRAINT `invoice_customer_fk` FOREIGN KEY (`CUST_CODE`) REFERENCES `customer` (`CUST_CODE`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `invoice_employee_fk` FOREIGN KEY (`EMPLOYEE_ID`) REFERENCES `employee` (`EMP_NUM`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;


CREATE TABLE `product` (
  `PROD_SKU` char(15) NOT NULL,
  `PROD_DESCRIPT` char(255) NOT NULL,
  `PROD_TYPE` char(255) NOT NULL,
  `PROD_BASE` char(255) NOT NULL,
  `PROD_CATEGORY` char(255) NOT NULL,
  `PROD_PRICE` decimal(16,2) NOT NULL,
  `PROD_QOH` decimal(16,2) NOT NULL,
  `PROD_MIN` decimal(16,2) NOT NULL,
  `BRAND_ID` int NOT NULL,
  PRIMARY KEY (`PROD_SKU`),
  CONSTRAINT `product_brand_fk` FOREIGN KEY (`BRAND_ID`) REFERENCES `brand` (`BRAND_ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;

CREATE TABLE `line` (
  `INV_NUM` int NOT NULL,
  `LINE_NUM` int NOT NULL,
  `PROD_SKU` varchar(15) NOT NULL,
  `LINE_QTY` double NOT NULL,
  `LINE_PRICE` decimal(16,2) NOT NULL,
  PRIMARY KEY (`LINE_NUM`, `INV_NUM`),
  CONSTRAINT `line_invoice_fk` FOREIGN KEY (`INV_NUM`) REFERENCES `invoice` (`INV_NUM`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `line_product_fk` FOREIGN KEY (`PROD_SKU`) REFERENCES `product` (`PROD_SKU`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;

CREATE TABLE `salary_history` (
  `EMP_NUM` int NOT NULL,
  `SAL_FROM` date NOT NULL,
  `SAL_END` date NOT NULL,
  `SAL_AMOUNT` decimal(16,2) NOT NULL,
  PRIMARY KEY (`SAL_FROM`,`EMP_NUM`),
  CONSTRAINT `salary_history_employee_fk` FOREIGN KEY (`EMP_NUM`) REFERENCES `employee` (`EMP_NUM`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;


CREATE TABLE `vendor` (
  `VEND_ID` int NOT NULL,
  `VEND_NAME` varchar(255) NOT NULL,
  `VEND_STREET` varchar(50) NOT NULL,
  `VEND_CITY` varchar(50) NOT NULL,
  `VEND_STATE` varchar(2) NOT NULL,
  `VEND_ZIP` varchar(5) NOT NULL,
  PRIMARY KEY (`VEND_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;



CREATE TABLE `supplies` (
  `PROD_SKU` varchar(15) NOT NULL,
  `VEND_ID` int NOT NULL,
  PRIMARY KEY (`PROD_SKU`),
  CONSTRAINT `supplies_product_fk` FOREIGN KEY (`PROD_SKU`) REFERENCES `product` (`PROD_SKU`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `supplies_vendor_fk` FOREIGN KEY (`VEND_ID`) REFERENCES `vendor` (`VEND_ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8MB3;

